--Creating Database SupplyChain
CREATE DATABASE SupplyChain
USE SupplyChain

--Create Products Table
CREATE TABLE Products (
	ProductID INT PRIMARY KEY IDENTITY,
	ProductName VARCHAR(225),
	Category VARCHAR(100),
	SupplierID INT FOREIGN KEY REFERENCES Suppliers (SupplierID),
	CostPrice DECIMAL(10,2)
)

--Create Suppliers Table
CREATE TABLE Suppliers (
SupplierID INT PRIMARY KEY IDENTITY,
SupplierName VARCHAR(225),
Region VARCHAR (50),
Rating INT
)

--Create Warehouses Table
CREATE TABLE Warehouses (
WarehouseID INT PRIMARY KEY IDENTITY,
WarehouseName VARCHAR(225),
City VARCHAR (100),
State VARCHAR (100),
Capacity INT
)

--Create Orders Table
CREATE TABLE Orders (
OrderID INT PRIMARY KEY IDENTITY,
ProductID INT FOREIGN KEY REFERENCES Products (ProductID),
OrderDate DATE,
Quantity INT,
UnitPrice Decimal (10,2),
CustomerID INT,
WarehouseID INT FOREIGN KEY REFERENCES Warehouses (WarehouseID)
)

--Create Inventory Table
CREATE TABLE Inventory (
ProductID INT,
WarehouseID INT,
StockQuantity INT,
ReorderLevel INT,
LastRestockDate DATE
)

--Create Shipments Table
CREATE TABLE Shipments (
ShipmentID INT PRIMARY KEY IDENTITY,
OrderID INT FOREIGN KEY REFERENCES Orders(OrderID),
DispatchDate DATE,
DeliveryDate DATE,
Status VARCHAR(50)
)

